import React from 'react'

export default function Vital({vitalData}) {
    return (
      <div className="vitalContent">
        <div className="vitalHeader p-2 border-bottom">Patient Vitals</div>
        <div className="d-flex p-3 ">
          {Object.keys(vitalData).map((key)=>(
            <div className="d-flex vital-item">
              <div className="vital-lhs">{key} :</div>
              <div className="vital-rhs">{vitalData[key]}</div>
            </div>

          ))}
        </div>
      </div>
    );
}
